var backPacks = input.Split(Environment.NewLine);

int total = StarTwo(backPacks);

static int StarOne(string[] backPacks)
{
    var sum = 0;
    foreach(var backpack in backPacks)
    {
        int itemsPerCompartment = backpack.Length / 2;
        var firstComp = backpack.Take(itemsPerCompartment);
        var secondComp = backpack.TakeLast(itemsPerCompartment);

        var commonItems = firstComp.Intersect(secondComp);
        var weighting = GetWeighting(commonItems.First());

        sum += weighting;
    }

    return sum;
}

static int StarTwo(string[] backPacks)
{
    var sum = 0;
    for(int i = 0; i < backPacks.Length; i +=3)
    {
        var elfGroup = backPacks.Take(new Range(i, i+3)).ToArray();
        
        var commonItems = elfGroup[0].Intersect(elfGroup[1]).Intersect(elfGroup[2]);
        var weighting = GetWeighting(commonItems.First());

        sum += weighting;
    }

    return sum;
}

static int GetWeighting(char item)
{
    return (int)Enum.Parse(typeof(Alphabet), item.ToString());
}